€œown in your backyard.â€Â  Little did we know that there was little cash flow in the Silicon Valley market back then, and when confronted with that fact, we were left with a choice; we could give up, we could go out of state, or we could find a market within driving distance. We found our answer a 2.5 hour drive away, in Fresno, California. After refining a new buy box in Fresno, we bought Norris Drive at the end of 2002, and we were new landlords. If you read my first book, you know that our first tenant was a nightmare, but we pressed on.</span>'),(14852,198,'_builder_repeater_0_about_story_group_sections_1_content','field_60f9c840a20bd'),(14853,198,'builder_repeater_0_about_story_group_sections_1_image','123'),(14854,198,'_builder_repeater_0_about_story_group_sections_1_image','field_60f9c901b98fb'),(14855,202,'builder_repeater_0_layout','About Story'),(14856,202,'_builder_repeater_0_layout','field_6412167d38ea3'),(14857,202,'builder_repeater_0_about_story_group_sections_0_data_aos','fade-up'),(14858,202,'_builder_repeater_0_about_story_group_sections_0_data_aos','field_61003aa8b3a47'),(14859,202,'builder_repeater_0_about_story_group_sections_0_label','1800s'),(14860,202,'_builder_repeater_0_about_story_group_sections_0_label','field_60f9c839a20bc'),(14861,202,'builder_repeater_0_about_story_group_sections_0_content','Lorem ipsum is placeholder text commonly used in the graphic, print, and publishing industries for previewing layouts and visual mockups.'),(14862,202,'_builder_repeater_0_about_story_group_sections_0_content','field_60f9c840a20bd'),(14863,202,'builder_repeater_0_about_story_group_sections_0_image','123'),(14864,202,'_builder_repeater_0_about_story_group_sections_0_image','field_60f9c901b98fb'),(14865,202,'builder_repeater_0_about_story_group_sections','2'),(14866,202,'_builder_repeater_0_about_story_group_sections','field_64384c81ef60d_field_60f9c7c2a20bb'),(14867,202,'builder_repeater_0_about_story_group',''),(14868,202,'_builder_repeater_0_about