20bd'),(18873,198,'builder_repeater_0_about_story_group_sections_2_image','223'),(18874,198,'_builder_repeater_0_about_story_group_sections_2_image','field_60f9c901b98fb'),(18875,198,'builder_repeater_0_about_story_group_sections_3_data_aos','fade-up'),(18876,198,'_builder_repeater_0_about_story_group_sections_3_data_aos','field_61003aa8b3a47'),(18877,198,'builder_repeater_0_about_story_group_sections_3_label','2010'),(18878,198,'_builder_repeater_0_about_story_group_sections_3_label','field_60f9c839a20bc'),(18879,198,'builder_repeater_0_about_story_group_sections_3_content','<span style=\"font-weight: 400;\">The Great Recession was in full swing by 2010, and real estate was on sale at below land value in many markets. We were active, but we turbo charged our buying by borrowing private money from friends and family. I was writing a blog about our investing at the time, and it piqued the interest of our friends and family, who started offering to lend us money. During the recession, investors were pulling their money from the market and earned nothing in the banks. We offered our friends and family 10% interest on guaranteed safe and secure properties, and everyone won. Building a reputation and track record allowed us to borrow millions of dollars and pay 10% interest for years!</span>'),(18880,198,'_builder_repeater_0_about_story_group_sections_3_content','field_60f9c840a20bd'),(18881,198,'builder_repeater_0_about_story_group_sections_3_image','235'),(18882,198,'_builder_repeater_0_about_story_group_sections_3_image','field_60f9c901b98fb'),(18883,198,'builder_repeater_0_about_story_group_sections_4_data_aos','fade-up'),(18884,198,'_builder_repeater_0_about_story_group_sections_4_data_aos','field_61003aa8b3a47'),(18885,198,'builder_repeater_0_about_story_group_sections_4_label','2015'),(18886,198,'_builder_repeater_0_about_story_group_sections_4_label','field_60f9c839a20bc'),(18887,198,'builder_repeater_0_about_story_group_sections_4_content','<span style=\"font-weight: 400;\">After over 12 years of living wildly below our means, it was time to smell the roses a little bit. Olivia retired from her day job after we saved her income for a year to prove that we didnâ€™t need it. It is embarrassing to admit that 2015 was the first year that I looked up and realized that the little trickle of cash flow had grown into something bigger.Â  You see, we had been buying dilapidated properties for so long that it was pretty common for us to send in checks to cover remodel bills (for which we budgeted at purchase). In 2015, I remember asking Olivia why we hadnâ€™t written any checks for our last few projects, and she told me that our cash flow covered the remodel. I was shocked! Because she ran the books and I looked for deals, I never thought to stop to look at our growing cash flow.</span>'),(18888,198,'_builder_repeater_0_about_story_group_sections_4_content','field_60f9c840a20bd'),(18889,198,'builder_repeater_0_about_story_group_sections_4_image','243'),(18890,198,'_builder_repeater_0_about_story_group_sections_4_image','field_60f9c901b98fb'),(18891,198,'builder_repeater_0_about_story_group_sections_5_data_aos','fade-up'),(18892,198,'_builder_repeater_0_about_story_group_sections_5_data_aos','field_61003aa8b3a47'),(18893,198,'builder_repeater_0_about_story_group_sections_5_label','2018'),(18894,198,'_builder_repeater_0_about_story_group_sections_5_label','field_60f9c839a20bc'),(18895,198,'builder_repeater_0_about_story_group_sections_5_content','<span style=\"font-weight: 400;\">What a crazy year 2018 was. I can still remember heading to the office in early 2018, looking forward to the new year, only to return home one hour later as a retiree. After a couple weeks of excitement over my newfound freedom, I was left to ponder what exactly to do with my time, and I was getting very depressed.Â  My whole being and ego was wrapped up in being a hard-charging â€œType A personality,â€ and now that I no longer had the motivating force of a career, I felt increasingly unmoored. I remember sitting at my kitchen table with Olivia thinking, â€œThis sucks! I need to get a job!â€ Then I remembered what a complete and utter mistake that would be, as so many only dream of being retired at 45. That weekend I decided to launch </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\"> and to start flipping properties by buying run-down slumlord-owned buildingsÂ  and creating pride-of-ownership rentals. We successfully flipped over 50 properties into pride-of-ownership rentals, which felt great. I also launched the </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\"> YouTube channel (please like, comment, and subscribe).</span>'),(18896,198,'_builder_repeater_0_about_story_group_sections_5_content','field_60f9c840a20bd'),(18897,198,'builder_repeater_0_about_story_group_sections_5_image','236'),(18898,198,'_builder_repeater_0_about_story_group_sections_5_image','field_60f9c901b98fb'),(18899,198,'builder_repeater_0_about_story_group_sections_6_data_aos','fade-up'),(18900,198,'_builder_repeater_0_about_story_group_sections_6_data_aos','field_61003aa8b3a47'),(18901,198,'builder_repeater_0_about_story_group_sections_6_label','2019'),(18902,198,'_builder_repeater_0_about_story_group_sections_6_label','field_60f9c839a20bc'),(18903,198,'builder_repeater_0_about_story_group_sections_6_content','<span style=\"font-weight: 400;\">If you know me at all, you would know that I have my strengths and some significant weaknesses. One of my weaknesses is writing. To be honest, I find writing not just difficult, but exhausting, as the words smash together and the letters seem jumbled in my head. I share this with you because despite this weakness, I managed to self-publish my first book </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\">, which became an Amazon Best Seller and has over 1,200 five star reviews. Iâ€™ve even had people tell me that the book changed their life, which is amazing to hear. If you own a copy of the book, I would love it if you would take a book selfie and tag me on Instagram! I have a corkboard in my office full of </span><i><span style=\"font-weight: 400;\">One Rental at a Time </span></i><span style=\"font-weight: 400;\">book selfies. Seeing that book take off and change lives has been one of the greatest joys of my life.</span>'),(18904,198,'_builder_repeater_0_about_story_group_sections_6_content','field_60f9c840a20bd'),(18905,198,'builder_repeater_0_about_story_group_sections_6_image','224'),(18906,198,'_builder_repeater_0_about_story_group_sections_6_image','field_60f9c901b98fb'),(18907,198,'builder_repeater_0_about_story_group_sections_7_data_aos','fade-up'),(18908,198,'_builder_repeater_0_about_story_group_sections_7_data_aos','field_61003aa8b3a47'),(18909,198,'builder_repeater_0_about_story_group_sections_7_label','2020'),(18910,198,'_builder_repeater_0_about_story_group_sections_7_label','field_60f9c839a20bc'),(18911,198,'builder_repeater_0_about_story_group_sections_7_content','<span style=\"font-weight: 400;\">After the crazy success of </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\">, I wanted to expand my reach to help more hopeful investors. People were constantly asking me for advice and I could only do so much to assist them. That is when I decided to spend months creating the </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\"> course on Teachable.Â  This is my no-nonsense, straight-to-the-work course that is helping thousands of investors do the work every day. I have gone on to add bonus sections and additional topics as I work with creators in new areas. All in all, the one thing I am most proud of is the private Facebook group I created for </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\"> students! I originally thought it would become a FAQ repository, but boy was I wrong. It has become the happiest place on the internet, with folks sharing wins, asking questions, and networking. The group is free to join when you buy the course. Just search for the Facebook group titled â€œOne Rental at a Time Worksâ€ and request to join.</span>'),(18912,198,'_builder_repeater_0_about_story_group_sections_7_content','field_60f9c840a20bd'),(18913,198,'builder_repeater_0_about_story_group_sections_7_image','242'),(18914,198,'_builder_repeater_0_about_story_group_sections_7_image','field_60f9c901b98fb'),(18915,198,'builder_repeater_0_about_story_group_sections_8_data_aos','fade-up'),(18916,198,'_builder_repeater_0_about_story_group_sections_8_data_aos','field_61003aa8b3a47'),(18917,198,'builder_repeater_0_about_story_group_sections_8_label','2021'),(18918,198,'_builder_repeater_0_about_story_group_sections_8_label','field_60f9c839a20bc'),(18919,198,'builder_repeater_0_about_story_group_sections_8_content','<span style=\"font-weight: 400;\">Â I knew great things would come out of my first course </span><i><span style=\"font-weight: 400;\">How to Get Started</span></i><span style=\"font-weight: 400;\">, as it gave people the understanding they needed to begin the investment process. However, it is my second course, </span><i><span style=\"font-weight: 400;\">Get your Money Right</span></i><span style=\"font-weight: 400;\">, that I am even more proud of. The course is anchored by three themes that were important to us on our journey but didnâ€™t really fit neatly within my first course. It begins with a discussion of â€œneedsâ€ versus â€œwants,â€ which is a vital distinction that needs to be made in order to stay focused on understanding where your money goes. From there I try to help the student understand cost discretionary items in â€œtime versus dollarâ€ amount. For example, I explain that a new phone doesnâ€™t cost you $1,000, it costs you 160 hours of working based on your discretionary take-home. Lastly, I ask students to review their lifestyle. I ask them to document their current lifestyle, their â€œminimumâ€ lifestyle, and their ideal â€œballerâ€ lifestyle. This is a great family exercise that really sparks conversation and helps students and their families develop a collaborative vision.Â </span>\r\n\r\n<span style=\"font-weight: 400;\">Another amazing personal development in 2021 was the publishing of my second book, </span><i><span style=\"font-weight: 400;\">15 Conversations with Real Estate Millionaires</span></i><span style=\"font-weight: 400;\">. While I was writing it, I had this vision of creating a book that I wished had existed during the first five years of my real estate investing journey. Investing in real estate is amazing, but boy can those first five years really suck while you are learning, making mistakes, and getting only a trickle of cash flow.Â  I wanted a book that any investor could hold on to and re-read as needed as a reminder that the journey is possible and worth it. I think I crushed it, and in it you will find 15 very different and distinct stories that are worth revisiting time and time again. If you read the book, please leave a 5 star review and take a book selfie. As an added bonus, Dion from </span><i><span style=\"font-weight: 400;\">Dion Talk </span></i><span style=\"font-weight: 400;\">did us the pleasure of narrating the audiobook on Audible! I still canâ€™t believe he did that for us, and I am forever grateful! Thank you Dion!</span>'),(18920,198,'_builder_repeater_0_about_story_group_sections_8_content','field_60f9c840a20bd'),(18921,198,'builder_repeater_0_about_story_group_sections_8_image','239'),(18922,198,'_builder_repeater_0_about_story_group_sections_8_image','field_60f9c901b98fb'),(18923,198,'builder_repeater_0_about_story_group_sections_9_data_aos','fade-up'),(18924,198,'_builder_repeater_0_about_story_group_sections_9_data_aos','field_61003aa8b3a47'),(18925,198,'builder_repeater_0_about_story_group_sections_9_label','2022'),(18926,198,'_builder_repeater_0_about_story_group_sections_9_label','field_60f9c839a20bc'),(18927,198,'builder_repeater_0_about_story_group_sections_9_content','<span style=\"font-weight: 400;\">We did something as a community that I had never dreamed of. We hosted the first ever </span><i><span style=\"font-weight: 400;\">ORaaT Mastermind</span></i><span style=\"font-weight: 400;\"> event, with eight speakers and roughly 200 attendees, where we shared knowledge and answered questions. To everyoneâ€™s relief, there was nary a single PowerPoint slide in sight, and 90% of the event was audience driven. This event far exceeded my expectations and its success blew me away. I was so happy that I spent the extra money to record it, and now you too can experience it and see what everyone is raving about.</span>'),(18928,198,'_builder_repeater_0_about_story_group_sections_9_content','field_60f9c840a20bd'),(18929,198,'builder_repeater_0_about_story_group_sections_9_image','240'),(18930,198,'_builder_repeater_0_about_story_group_sections_9_image','field_60f9c901b98fb'),(18931,198,'builder_repeater_0_about_story_group_sections_10_data_aos','fade-up'),(18932,198,'_builder_repeater_0_about_story_group_sections_10_data_aos','field_61003aa8b3a47'),(18933,198,'builder_repeater_0_about_story_group_sections_10_label','2023'),(18934,198,'_builder_repeater_0_about_story_group_sections_10_label','field_60f9c839a20bc'),(18935,198,'builder_repeater_0_about_story_group_sections_10_content','<span style=\"font-weight: 400;\">After returning from a 30 day trip to Southeast Asia, I realized that we are all better together and I need to do a better job of merging my growing Rolodex of experts and my </span><i><span style=\"font-weight: 400;\">One Rental at a Time</span></i><span style=\"font-weight: 400;\"> family. I plan to host at least one virtual event a month with a capacity of 100 attendees to keep the interaction controlled and valuable for everyone. In addition, I hope to hit 50,000 YouTube Subscribers so we can start planning our Las Vegas Event and celebrate together.</span>'),(18936,198,'_builder_repeater_0_about_story_group_sections_10_content','field_60f9c840a20bd'),(18937,198,'builder_repeater_0_about_story_group_sections_10_image','237'),(18938,198,'_builder_repeater_0_about_story_group_sections_10_image','field_60f9c901b98fb'),(18947,253,'_edit_lock','1683129946:1'),(18948,254,'_wp_attached_file','2023/04/How-to-Start-One-Rental-at-a-Time.jpg'),(18949,254,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1024;s:6:\"height\";i:512;s:4:\"file\";s:45:\"2023/04/How-to-Start-One-Rental-at-a-Time.jpg\";s:8:\"filesize\";i:50413;s:5:\"sizes\";a:3:{s:6:\"medium\";a:5:{s:4:\"file\";s:45:\"How-to-Start-One-Rental-at-a-Time-300x150.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:5058;}s:9:\"thumbnail\";a:5:{s:4:\"file\";s:45:\"How-to-Start-One-Rental-at-a-Time-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:3586;}s:12:\"medium_large\";a:5:{s:4:\"file\";s:45:\"How-to-Start-One-Rental-at-a-Time-768x384.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:384;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:19686;}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(18950,254,'_wp_attachment_image_alt','How-to-Start-One-Rental-at-a-Time'),(18951,253,'_edit_last','1'),(18952,253,'builder_repeater','1'),(18953,253,'_builder_repeater','field_6412166638ea2'),(18954,253,'custom_css',''),(18955,253,'_custom_css