egoalinvestments.com/wlth</a>'),(19180,282,'_builder_repeater_0_content_+_image_content_middle_group_content','field_64121dfa4983f_field_64121cb1f734d'),(19181,282,'builder_repeater_0_content_+_image_content_middle_group',''),(19182,282,'_builder_repeater_0_content_+_image_content_middle_group','field_64121d45a2e25_field_64121df04983e'),(19183,282,'builder_repeater_0_content_+_image_gallery','a:1:{i:0;s:3:\"283\";}'),(19184,282,'_builder_repeater_0_content_+_image_gallery','field_64121d45a2e25_field_64383c314ca8b'),(19185,282,'builder_repeater_0_content_+_image_content_bottom_group_content_col_classes',''),(19186,282,'_builder_repeater_0_content_+_image_content_bottom_group_content_col_classes','field_64121fa2dc9b1_field_64121c95f734b'),(19187,282,'builder_repeater_0_content_+_image_content_bottom_group_content_col_style',''),(19188,282,'_builder_repeater_0_content_+_image_content_bottom_group_content_col_style','field_64121fa2dc9b1_field_64121ca7f734c'),(19189,282,'builder_repeater_0_content_+_image_content_bottom_group_content',''),(19190,282,'_builder_repeater_0_content_+_image_content_bottom_group_content','field_64121fa2dc9b1_field_64121cb1f734d'),(19191,282,'builder_repeater_0_content_+_image_content_bottom_group',''),(19192,282,'_builder_repeater_0_content_+_image_content_bottom_group','field_64121d45a2e25_field_64121fa2dc9af'),(19193,282,'builder_repeater_0_content_+_image',''),(19194,282,'_builder_repeater_0_content_+_image','field_64121d3da2e24'),(19195,282,'builder_repeater','5'),(19196,282,'_builder_repeater','field_6412166638ea2'),(19197,282,'custom_css',''),(19198,282,'_custom_css','field_605cafca65108'),(19199,282,'_yoast_wpseo_estimated-reading-time-minutes','0'),(19200,282,'_yoast_wpseo_wordproof_timestamp',''),(19201,283,'_wp_attached_file','2023/05/Taylor-Sohns-Coffee-Shop.jpg'),(19202,283,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1500;s:6:\"height\";i:2000;s:4:\"file\";s:36:\"2023/05/Taylor-Sohns-Coffee-Shop.jpg\";s:8:\"filesize\";i:201568;