>\r\n 	<li>The Psychology of Money- Morgan Housel</li>\r\n 	<li>Principles- Ray Dalio</li>\r\n 	<li>Good to Great â€“ Jim Collins</li>\r\n 	<li>Thinking in Bets- Annie Duke</li>\r\n</ul>\r\n<strong>Socials</strong>:\r\n<ul>\r\n 	<li>Instagram: <a href=\"https://www.instagram.com/lifegoalinvestments/\" target=\"_blank\" rel=\"noopener\">@lifegoalinvestments</a></li>\r\n 	<li>TikTok: <a href=\"https://www.tiktok.com/@lifegoalinvestments\" target=\"_blank\" rel=\"noopener\">@lifegoalinvestments</a></li>\r\n 	<li>YouTube: <a href=\"https://www.youtube.com/@lifegoalinvestments1\" target=\"_blank\" rel=\"noopener\">@lifegoalinvestments1</a></li>\r\n</ul>\r\n<strong>Website</strong>:\r\n<ul>\r\n 	<li><a href=\"http://www.lifegoalinvestments.com/wlth\" target=\"_blank\" rel=\"noopener\">www.lifegoalinvestments.com/wlth</a></li>\r\n</ul>'),(19255,282,'_builder_repeater_1_content_plain_group_content','field_64528c16ecc05_field_64121cb1f734d'),(19256,282,'builder_repeater_1_content_plain_group',''),(19257,282,'_builder_repeater_1_content_plain_group','field_64528bfaecc04'),(19258,288,'_wp_attached_file','2023/05/April-Crossley.jpg'),(19259,288,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1920;s:6:\"height\";i:1282;s:4:\"file\";s:26:\"2023/05/April-Crossley.jpg\";s:8:\"filesize\";i:190112;s:5:\"sizes\";a:5:{s:6:\"medium\";a:5:{s:4:\"file\";s:26:\"April-Crossley-300x200.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:200;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:11418;}s:5:\"large\";a:5:{s:4:\"file\";s:27:\"April-Crossley-1024x684.jpg\";s:5:\"width\";i:1024;s:6:\"height\";i:684;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:70591;}s:9:\"thumbnail\";a:5:{s:4:\"file\";s:26:\"April-Crossley-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:5678;}s:12:\"medium_large\";a:5:{s:4:\"file\";s:26:\"April-Crossley-768x513.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:513;s:9:\"mime-type\";s:10:\"image/jpeg\";