 April speaks frequently on podcast interviews and at conferences about her journey from teenage mom to millionaire. She is passionate about helping other people grow wealth with real estate by helping them find the path that is best for them: flipping vs. owning rental property vs. passive investing.\r\n\r\n<strong>Books</strong>:\r\n<ul>\r\n 	<li>15 Secrets Successful people know about time management</li>\r\n 	<li>Atomic Habits</li>\r\n 	<li>Tribe of Millionaires</li>\r\n</ul>\r\n<strong>Socials</strong>:\r\n<ul>\r\n 	<li>Instagram: <a href=\"https://www.instagram.com/april_crossley/\" target=\"_blank\" rel=\"noopener\">https://www.instagram.com/april_crossley/</a></li>\r\n 	<li>Facebook: <a href=\"https://www.facebook.com/lazygirlrei\" target=\"_blank\" rel=\"noopener\">https://www.facebook.com/lazygirlrei</a></li>\r\n 	<li>YouTube: <a href=\"https://www.youtube.com/@aprilcrossley/videos\" target=\"_blank\" rel=\"noopener\">https://www.youtube.com/@aprilcrossley/videos</a></li>\r\n</ul>'),(19286,282,'_builder_repeater_2_content_plain_group_content','field_64528c16ecc05_field_64121cb1f734d'),(19287,282,'builder_repeater_2_content_plain_group',''),(19288,282,'_builder_repeater_2_content_plain_group','field_64528bfaecc04'),(19289,289,'_wp_attached_file','2023/05/Brian-Adamson-e1683132850777.jpg'),(19290,289,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1335;s:6:\"height\";i:1335;s:4:\"file\";s:40:\"2023/05/Brian-Adamson-e1683132850777.jpg\";s:8:\"filesize\";i:147150;s:5:\"sizes\";a:5:{s:6:\"medium\";a:5:{s:4:\"file\";s:40:\"Brian-Adamson-e1683132850777-300x300.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:15354;}s:5:\"large\";a:5:{s:4:\"file\";s:42:\"Brian-Adamson-e1683132850777-1024x1024.jpg\";s:5:\"width\";i:1024;s:6:\"height\";i:1024;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:126277;}s:9:\"thumbnail\";a:5:{s:4:\"file\";s:40:\"Brian-Adamson-e1683132850777-150x150.jpg\";s:5:\"width\";i:150;s